        "            if row['x'] >= 0 and row['y'] >= 0 and row['x'] + row['w'] <= img.shape[1] and row['y'] + row['h'] <= img.shape[0]:\n",
        "\n",
        "              cropped_img_resized = cv2.resize(crop_image(img, row['x'], row['y'], row['w'], row['h']), img_size)\n",
